DROP TABLE IF EXISTS `Parameters`;
CREATE TABLE `Parameters`(
`ID` int(11) NOT NULL /*AUTO_INCREMENT*/,
`NAME` varchar(255) DEFAULT NULL,
`ABREVIATION` varchar(255) DEFAULT NULL,
`XPRESSO_ID` int(11) DEFAULT NULL,
`DESCRIPTION` varchar(255) DEFAULT NULL,
`MIN_RANGE` int(11) DEFAULT NULL,
`MAX_RANGE` int(11) DEFAULT NULL,
`CATEGORY_ID` int(11) DEFAULT NULL,
`DEFAULT_UNIT_ID` int(11) DEFAULT NULL,
`DEFAULT_LINE_COLOR` int(11) DEFAULT NULL,
`DEFAULT_FORMAT` varchar(255) DEFAULT NULL,
`ACTIVITY_TIMEOUT` int(11) DEFAULT NULL,
`FORMULA` int(11) DEFAULT NULL,
`SamplingInterval` int(11) DEFAULT NULL,
`SimulatorType` int(11) DEFAULT NULL,
`DEFAULT_IMAGE` int(11) DEFAULT NULL,
`DEFAULT_POINT_SIZE` int(11) DEFAULT NULL,
`DEFAULT_POINT_COLOR` float(11) DEFAULT NULL,
`DEFAULT_LINE_THICKNESS` float(11) DEFAULT NULL,
`DEFAULT_COLOR` int(11) DEFAULT NULL,
`DEFAULT_SHOW_POINTS` int(11) DEFAULT NULL,
`DEFAULT_LINE_STYLE` int(11) DEFAULT NULL,
`DEFAULT_LINE_DASHSTYLE` int(11) DEFAULT NULL,
`LASTMODIFIED` time(6)  DEFAULT NULL,
`LASTMODIFIEDUSERID` int(11) DEFAULT NULL,
`IsActive` float(11) DEFAULT NULL,
`SortSeq` int(11) DEFAULT NULL,
`MPV_Image` blob(4096) DEFAULT NULL,
`MPV_LineDashStyle` int(11) DEFAULT NULL,
`MPV_PointSize` int(11) DEFAULT NULL,
`MPV_ShowPoints` int(11) DEFAULT NULL,
`MPV_ShowValues` int(11) DEFAULT NULL,
`LookupType` int(11) DEFAULT NULL,
`UpdateId` int(11) DEFAULT NULL,
`UpdatedAt` int(11) DEFAULT NULL,
PRIMARY KEY (`ID`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=utf8;

